eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   myteam: () => (/* binding */ myteam)\n/* harmony export */ });\nconst myteam = [\n    {\n        name: \"Pedro Reviriego\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.5\",\n        description: \"Pedro Reviriego received the M.Sc. and Ph.D. degrees in telecommunications engineering from the Technical University of Madrid, Madrid, Spain, in 1994 and 1997, respectively. From 1997 to 2000, he was an Engineer with Teldat, Madrid, working on router implementation. In 2000, he joined Massana to work on the development of 1000BASE-T transceivers. From 2004 to 2007, he was a Distinguished Member of Technical Staff with the LSI Corporation, working on the development of Ethernet transceivers. From 2007 to 2018 he was with Nebrija University, from 2018 to 2022 with Universidad Carlos III de Madrid. He is currently with Universidad Politécnica de Madrid working mainly of generative AI.\",\n        description_es: \"Pedro Reviriego obtuvo los títulos de Ingeniero y Doctor en telecomunicaciones por la Universidad Politécnica de Madrid, Madrid, España, en 1994 y 1997, respectivamente. De 1997 a 2000, fue Ingeniero en Teldat, Madrid, trabajando en la implementación de enrutadores. En el año 2000, se unió a Massana para trabajar en el desarrollo de transceptores 1000BASE-T. De 2004 a 2007, fue Miembro Distinguido del Personal Técnico en LSI Corporation, trabajando en el desarrollo de transceptores Ethernet. De 2007 a 2018 estuvo en la Universidad Nebrija, de 2018 a 2022 en la Universidad Carlos III de Madrid. Actualmente, se encuentra en la Universidad Politécnica de Madrid trabajando principalmente en inteligencia artificial generativa.\",\n        img: \"assets/img/team/pedro-reviriego.jpg\",\n        email: \"pedro.reviriego@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"8\",\n        researchgate: \"\",\n        orcid: \"https://orcid.org/0000-0003-2540-5234\",\n        webOfScience: \"\",\n        googleScholar: \"https://scholar.google.com/citations?user=Uq9ULaMAAAAJ&hl=es&oi=ao\",\n        linkedin: \"https://www.linkedin.com/in/pedro-reviriego-b582094/\",\n        portalUpm: \"https://portalcientifico.upm.es/es/ipublic/researcher/335879\"\n    },\n    {\n        name: \"Juan Quemada\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.1\",\n        description: \"Juan Quemada leads the Next Generation Internet Group within the Telematics Engineering Department, Universidad Politécnica de Madrid (UPM), where he is Full Professor. He is also the Telefonica Chair of UPM, for the next-generation Internet, and the UPM Representative at the World Wide Web Consortium. His research interests include collaborative and social application architecture for the Internet and the Web, including cloud computing, where he has a strong involvement in European and Spanish research.\",\n        description_es: \"\",\n        img: \"assets/img/team/juan-quemada.jpg\",\n        github: \"https://github.com/jquemada\",\n        email: \"juan.quemada@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"1\"\n    },\n    {\n        name: \"Enrique Barra\",\n        // position: \"team.professorCards.positions.1\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.2\",\n        description: \"Enrique Barra is a professor at Telematic Engineering Department, School of Telecommunications Engineering. He received the Ph.D. degree in Telematic Engineering from  Universidad Politécnica de Madrid (UPM). He has participated in many European projects, such as GLOBAL, FIWARE, and C@R. He is currently involved in several projects contributing to the generation and distribution of educational content. His research interests include artificial intelligence, e-safety, videoconferencing and games in education.\",\n        description_es: \"Enrique Barra es profesor del Departamento de Ingeniería Telemática de la Escuela Técnica Superior de Ingenieros de Telecomunicación. Se doctoró en Ingeniería Telemática por la Universidad Politécnica de Madrid (UPM). Ha participado en numerosos proyectos europeos, como GLOBAL, FIWARE y C@R. Actualmente participa en varios proyectos que contribuyen a la generación y distribución de contenidos educativos. Sus intereses de investigación incluyen la inteligencia artificial, uso seguro de las TIC, la videoconferencia y los juegos en la educación.\",\n        img: \"assets/img/team/enrique-barra.jpg\",\n        github: \"https://github.com/ebarra\",\n        email: \"enrique.barra@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        researchgate: \"https://www.researchgate.net/profile/Enrique-Barra\",\n        orcid: \"https://orcid.org/0000-0001-9532-8962\",\n        webOfScience: \"https://www.webofscience.com/wos/author/record/AAT-1273-2020\",\n        googleScholar: \"https://scholar.google.es/citations?hl=es-ES&user=NEtwvZkAAAAJ&hl\",\n        linkedin: \"https://www.linkedin.com/in/enriquebarra/\",\n        portalUpm: \"https://portalcientifico.upm.es/es/ipublic/researcher/309087\",\n        key: \"5\"\n    },\n    {\n        name: \"Álvaro Alonso\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.2\",\n        description: \"Álvaro Alonso, Ph.D. in Telecommunications Engineering, Professor at the Telematic Systems Engineering Department, School of Telecommunications Engineering, is a WebHTML5 Videoconference and Cloud Computing expert.He is the author of several articles and participates in a lot of Spanish and European research projects. His research interests include multi-conferencing systems in cloud computing, security, and the IoT in the future Internet.\",\n        description_es: \"Álvaro Alonso, Doctor Ingeniero de Telecomunicación, Profesor Contratado Doctor del Departamento de Ingeniería de Sistemas Telemáticos de la Escuela Técnica Superior de Ingenieros de Telecomunicación, es experto en Videoconferencia WebHTML5 y Cloud Computing. Es autor de varios artículos y participa en numerosos proyectos de investigación españoles y europeos. Sus intereses de investigación incluyen los sistemas de multiconferencia en cloud computing, la seguridad, el IoT en la Internet del futuro y los espacios de datos\",\n        img: \"assets/img/team/alvaro-alonso.jpg\",\n        github: \"https://github.com/aalonsog\",\n        email: \"alvaro.alonso@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"6\",\n        researchgate: \"https://www.researchgate.net/profile/Alvaro-Alonso-2\",\n        orcid: \"https://orcid.org/0000-0002-8456-8351\",\n        webOfScience: \"https://www.webofscience.com/wos/author/rid/AAO-5941-2020\",\n        googleScholar: \"https://scholar.google.es/citations?hl=es-ES&user=OO1ITq8AAAAJ\",\n        linkedin: \"https://www.linkedin.com/in/alvaroalonsogonzalez/\",\n        portalUpm: \"https://portalcientifico.upm.es/es/ipublic/researcher/310042\"\n    },\n    {\n        name: \"Aldo Gordillo\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.2\",\n        description: \"Aldo Gordillo received the degree in Telecommunications Engineering and the PhD degree in Telematics Engineering from UPM, in 2012 and 2017, respectively. From 2012 to 2017, he was a Research and Development Engineer with the Telematics Engineering Department, UPM. He is currently an Assistant Professor with the Computer Science Department, also at UPM. His research interests include the field of technology-enhanced learning, with a special focus on creation, evaluation, and dissemination of e-learning resources, computer science education, game-based learning, and e-learning systems.\",\n        description_es: \"\",\n        img: \"assets/img/team/aldo-gordillo.jpg\",\n        github: \"https://github.com/agordillo\",\n        email: \"a.gordillo@upm.es\",\n        center: \"E.T.S de ing. de sistemas informáticos\",\n        key: \"7\"\n    },\n    {\n        name: \"Gabriel Huecas\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.5\",\n        description: \"Gabriel Huecas, Ph.D in Telecommunications Engineering, is currently the Postgraduate Assistant Director at the School of Telecommunications Engineering of Universidad Politécnica de Madrid (UPM), as well as a professor at the same institution. He is the author of different Java 2 programming books.\",\n        description_es: \"\",\n        img: \"assets/img/team/gabriel-huecas.jpg\",\n        github: \"https://github.com/ghuecas\",\n        email: \"gabriel.huecas@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"4\"\n    },\n    {\n        name: \"Joaquín Salvachúa\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.5\",\n        description: \"Joaquín Salvachúa is a professor at UPM, where he received the M.Sc., Ph.D. in Telecommunications Engineering. He is also FIWARE Technical Steering Committee member elected as Remarkable individuals. His research interests include advanced cloud and edge architectures, big data infrastructure, data privacy and usage control, NoSql databases, applications, and identity in blockchain.\",\n        description_es: \"\",\n        img: \"assets/img/team/joaquin-salvachua.jpg\",\n        github: \"https://github.com/jsalvachua\",\n        email: \"joaquin.salvachua@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"2\"\n    },\n    {\n        name: \"Santiago Pavón\",\n        roleTranslationKey: \"team.professorCards.roles.5\",\n        position: \"\",\n        description: \"Santiago Pavón Gómez obtained the B.S. and Ph.D. in Telecommunication Engineer from the Universidad Politécnica de Madrid (UPM) in 1987 and 1990 respectively. Santiago obtained the position of Assistant Professor in 1991 and the position of Associate Professor in 1992. He has published several articles and participated in national and international research projects related to Formal Description Techniques, CSCW, Tele-Education, collaboration services, IPv6, virtualization, identity services, safely (Cyspa) and Blockchain (BAPI).\",\n        description_es: \"\",\n        img: \"assets/img/team/santiago-pavon.jpg\",\n        github: \"https://github.com/sanpago\",\n        email: \"santiago.pavon@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"3\"\n    },\n    {\n        name: \"Jose Andres Muñoz\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.6\",\n        description: \"Andrés received the B.S. in Telematic Engineering from Escuela Superior Politécnica del Litoral (ESPOL) in 2013 He received the M.Sc. in Telematic Services and Network Engineering from Universidad Politécnica de Madrid (UPM). Andrés is currently a Ph.D. student in Telecommunications Engineering and a Researcher with the Next Generation Internet Research Group. His previous experience includes Telematic Laboratories Coordination or Servers and Communications Assistant, both in ESPOL.Andres has carried out different research projects, such as Web Platform Development for Control and Monitoring of Environmental Parameters in Agriculture or Kiswar Proyect Reactive Evacuation Management Systemsfor Emergency Situations.\",\n        description_es: \"\",\n        img: \"assets/img/team/jose-andres-munoz.jpg\",\n        github: \"https://github.com/anmunoz\",\n        email: \"joseandres.munoz@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"9\"\n    },\n    {\n        name: \"Alejandro Pozo\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.6\",\n        description: \"Researcher and Ph.D. student at Politécnica of Madrid (UPM). He received the M.Sc. in Telecommunications Engineering from the UPM, Spain, in 2017, where he is currently pursuing the Ph.D. in Telecommunications Engineering and is a Research Assistant with the Next Generation Internet Research Group. He participates in several European projects and publishes results in journals related to the Internet of Things, security, and identity management.\",\n        description_es: \"Alejandro Pozo se doctoró y obtuvo un máster en Ingeniería de Telecomunicaciones en la UPM, España, donde actualmente trabaja como profesor. Ha participado en varios proyectos europeos y ha realizado varias publicaciones en revistas de prestigio relacionadas con el Internet de las Cosas, la seguridad y la gestión de identidades. Actualmente investiga sobre sistemas de interpretación remota basados en herramientas de videoconferencia.\",\n        img: \"assets/img/team/alejandro-pozo.jpg\",\n        github: \"https://github.com/apozohue10\",\n        email: \"alejandro.pozo@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"10\",\n        researchgate: \"https://www.researchgate.net/profile/Alejandro-Pozo-Huertas\",\n        orcid: \"https://orcid.org/0000-0002-2160-1978\",\n        webOfScience: \"https://www.webofscience.com/wos/author/record/28872104\",\n        googleScholar: \"https://scholar.google.es/citations?user=rLseLmAAAAAJ&hl=es&oi=ao\",\n        linkedin: \"https://www.linkedin.com/in/alejandro-pozo-huertas-540628182/\",\n        portalUpm: \"https://portalcientifico.upm.es/es/ipublic/researcher/308554\"\n    },\n    {\n        name: \"Carlos Arriaga\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.3\",\n        description: \"Carlos is a Ph.D. student in Telecommunication Engineering at Universidad Politécnica de Madrid (UPM).  He received the B.S. and M.Sc. in Telecommunications Engineering from UPM in 2020 and 2022. His research interests lie in primarily in the field of video-conference scalability and WebRTC.\",\n        description_es: \"\",\n        img: \"assets/img/team/carlos-arriaga.jpg\",\n        github: \"https://github.com/Arri98\",\n        email: \"carlos.arriaga.prieto@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"13\",\n        researchgate: \"https://www.researchgate.net/profile/Carlos-Arriaga-Prieto\",\n        orcid: \"https://orcid.org/0000-0002-0513-2550\",\n        webOfScience: \"\",\n        googleScholar: \"\",\n        linkedin: \"https://www.linkedin.com/in/carlos-arriaga-prieto-467a791a2/\",\n        portalUpm: \"https://portalcientifico.upm.es/es/ipublic/researcher/334119\"\n    },\n    {\n        name: \"Javier Conde\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.6\",\n        description: \"Javier Conde, received a Ph.D. in Telematics Engineering at UPM where he is now an assistant professor in the Department of Telematics Engineering. Since 2024 Javier became a Young Scholar member of the Marconi Society, being the first Spanish researcher to receive this recognition. Javier is coordinating the IEEE Spanish Local Group on AI. His research interests lie in the fields of Digital Twins, Big Data and Artificial Intelligence.\",\n        description_es: \"Javier Conde obtuvo un doctorado en Ingeniería Telemática en la UPM, donde actualmente es Profesor Ayudante Doctor en el Departamento de Ingeniería de Sistemas Telemáticos. Desde 2024, Javier se convirtió en Young Scholar de la Marconi Society, siendo el primer investigador español en recibir este reconocimiento. Actualmente también coordina el Grupo Local de España de IA del IEEE. Sus áreas de interés en investigación incluyen Gemelos Digitales, Big Data e Inteligencia Artificial.\",\n        img: \"assets/img/team/javier-conde.jpg\",\n        github: \"https://github.com/javicond3\",\n        email: \"javier.conde.diaz@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"11\",\n        researchgate: \"https://www.researchgate.net/profile/Javier-Conde-4\",\n        orcid: \"https://orcid.org/0000-0002-5304-0626\",\n        webOfScience: \"https://www.webofscience.com/wos/author/record/33174652\",\n        googleScholar: \"https://scholar.google.es/citations?hl=es-ES&user=2e_XTLcAAAAJ&hl\",\n        linkedin: \"https://www.linkedin.com/in/javier-conde-diaz/\",\n        portalUpm: \"https://portalcientifico.upm.es/es/ipublic/researcher/332900\"\n    },\n    {\n        name: \"Carlos Aparicio\",\n        position: \"\",\n        roleTranslationKey: \"team.professorCards.roles.3\",\n        description: \"\",\n        description_es: \"\",\n        img: \"assets/img/team/carlos-aparicio.jpeg\",\n        github: \"\",\n        email: \"ce.aparicio@upm.es\",\n        center: \"E.T.S. de ingenieros de telecomunicacion\",\n        key: \"30\"\n    },\n    {\n        \"name\": \"Iciar Villamayor\",\n        roleTranslationKey: \"team.professorCards.roles.7\",\n        \"description\": \"Iciar is a UX/UI designer. She received the B.S and M.Sc in graphic design and interactive graphic design from Escuela Superior de Diseño de Madrid in 2020 and 2021. She's currently teaching at Escuela Superior de Diseño de Madrid. She sporadically collaborates with the GING as a Digital Product Designer.\",\n        description_es: \"Icíar es diseñadora UX/UI. Se graduó del Grado en Diseño con especialización en gráfico de la Escuela Superior de Diseño de Madrid, donde también obtuvo su Master en Diseño Interactivo. Actualmente desempeña su labor como profesora de Medios Informáticos en la Escuela Superior de Diseño de Madrid y colabora esporádicamente con GING como diseñadora de producto digital.\",\n        \"img\": \"/assets/img/team/iciar-villamayor.jpg\",\n        \"github\": \"https://github.com/IciarVillamayor\",\n        \"email\": \"iciarvillamayor@hotmail.com\",\n        researchgate: \"https://www.researchgate.net/profile/Iciar-Villamayor-2\",\n        orcid: \"\",\n        webOfScience: \"\",\n        googleScholar: \"\",\n        linkedin: \"https://www.linkedin.com/in/ivillamayor/\",\n        portalUpm: \"\"\n    },\n    {\n        \"name\": \"Sonsoles López-Pernas\",\n        roleTranslationKey: \"team.professorCards.roles.8\",\n        \"description\": \"Sonsoles has a Ph.D. in Telematics Engineering from Universidad Politécnica de Madrid (UPM). Since 2015, she has conducted her research at the GING research group. She is currently an Assistant Professor at the Department of Computer Science at UPM. Her research interests include technology-enhanced learning, educational escape rooms, learning analytics, and data usage control.\",\n        description_es: \"\",\n        \"img\": \"/assets/img/team/sonsoles-lopez.jpg\",\n        \"github\": \"https://github.com/sonsoleslp\",\n        \"email\": \"sonsoles.lopez.pernas@upm.es\"\n    },\n    {\n        \"name\": \"Abel Carril\",\n        roleTranslationKey: \"team.professorCards.roles.8\",\n        description_es: \"\",\n        \"description\": \"Videoconference and streaming support specialist with more than 10 years of experience. Audio/Video encoding expert and Windows .NET C# desktop applications developer.\",\n        \"img\": \"/assets/img/team/abel-carril.jpg\",\n        \"github\": \"https://github.com/eibol\",\n        \"email\": \"abel.carril@upm.es\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./constants/team.js\n");

